import React, { Component } from 'react';
import InputText from './accountComponents/inputText.js'
import Piggy from './Home/homeComponents/piggy.js'

class Account extends Component {
    render() {
      return (
        <>
          <Piggy/>
          <InputText />
        </>
      );
    }
  }
  
  export default Account;
